import React from 'react';
import { SLoadMoreBtn, SLoadMoreBtnContainer } 
from '../styles/SLoadMoreBtn';

const NotFound = () => (

 <SLoadMoreBtnContainer>

 <SLoadMoreBtn type="button" onLongClick={window.location.reload(true)}>Return to homepage</SLoadMoreBtn>
 </SLoadMoreBtnContainer>

)

export default NotFound;
